describe("Unit testing easypiechart",function(){var e,t;beforeEach(module("easypiechart")),beforeEach(inject(function(i,a){e=i,t=a})),it("inserts the element with a canvas element",function(){var i=e("<div easypiechart></div>")(t);t.$digest(),expect(i.html()).toContain("canvas")}),it("takes size option the right way",function(){var i=e("<div easypiechart='size:200'></div>")(t);t.$digest(),expect(i.html()).toContain("200")})});